import React from 'react'

const Nav = () => {
  return (
    <ul>
        <li><button>Active ToDoes</button></li>
        <li><button>Completed ToDoes</button></li>
        <li><button>Create a ToDo</button></li>
        <li><button>Exit</button></li>
    </ul>
  )
}

export default Nav
